ast lesson first, although if you can't remember a step you can of course take a peek back at the last part to remind yourself.\n","\n","> Hint: Make sure you're assigning your data_frame to the variable name \"chocolateData\" at each step. This overwrites what was previously in the data_frame with your corrected version. You'll be able to tell that you've forgotten to do this because the whole data_frame will print out in your output!\n","\n","I've done some of the steps that we didn't talk about in a lot of detail for you, but if you try to run the cell without filling the rest of it in first, you're going to get an error message!"]},{"cell_type":"code","execution_count":1,"id":"137d67be","metadata":{"_cell_guid":"9c534969-453f-4e78-b545-d06600e1fd94","_uuid":"79afe21fc8fe7dfc42cf19e991e0de30c2c7d327","execution":{"iopub.execute_input":"2022-02-21T06:50:11.031057Z","iopub.status.busy":"2022-02-21T06:50:11.030241Z","iopub.status.idle":"2022-02-21T06:50:12.869611Z","shell.execute_reply":"2022-02-21T06:50:12.870167Z"},"papermill":{"duration":1.903915,"end_time":"2022-02-21T06:50:12.870422","exception":false,"start_time":"2022-02-21T06:50:10.966507","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b