o             \n","3 70            France           3.00             Togo             \n","4 70            France           3.50             Togo             \n","5 70            France           3.50             Peru             \n","6 70            France           2.75   Criollo   Venezuela        "]},"metadata":{},"output_type":"display_data"}],"source":["# Your turn!\n","\n","# tell R that we're going to use the tidyverse library\n","library(tidyverse)\n","# read in our dataset as a data_frame and save it as a variable named \"chocolateData\"\n","chocolateData <- read_csv(\"../input/flavors_of_cacao.csv\")\n","# remove the first line of our dataset using a negative index\n","\n","# remove the white spaces in the column names\n","names(chocolateData) <- gsub(\"[[:space:]+]\", \"_\", names(chocolateData))\n","\n","# remove percentage signs in the Cocoa_Percent \n","chocolateData$Cocoa_Percent <- sapply(chocolateData$Cocoa_Percent, function(x) gsub(\"%\", \"\", x))\n","\n","# automatically try to guess the data type of each column using type_convert\n","chocolateData <- type_convert(chocolateData)\n","# check the first few lines of our data_frame to make sure everything looks alright.\n","# Do you remember which function we've been using to do this?\n","head(chocolateData)"]},{"cell_type":"markdown","id":"6c31f362","metadata":{"_cell_guid":"ad4caa61-1a11-44bb-97de-fce339dbefc6","_uuid":"31ac82abc6fd57c665481c290bdfda0c0423a634","papermill":{"duration":0.120741,"end_time":"2022-02-21T06:50:13.11604","exception":false,"start_time":"2022-02-21T06:50:12.995299","status":"completed"},"tags":[]},"source":["## Graph our data with ggplot2"]},{"cell_type":"markdown","id":"b267f8a7","metadata":{"_cell_guid":"21cc4ce6-e5c8-43c6-960d-4e0fd1a3384d","_uuid":"591d2aca4d10a849d96f5647914da2d79614b59d","papermill":{"duration":0.120371,"end_time":"2022-02-21T06:50:13.357008","exception":false,"start_time":"2022-02-21T06:50:13.236637","status":"completed"},"tags":[]},"source":["Alright, now we've got our data and it's ready and clean! Time to make some graphs. To do this, we're going to use a library called \"ggplot2\", which is part of the tidyverse collection of packages. (Which means, since we've already imported the \"tidyverse\" library, we don't have to do anything else to start using it.)\n","\n","> The \"gg\" in \"ggplot\" stands for \"the grammar of graphics\". If you're curious, you can learn more about what this means in [this paper](http://vita.had.co.nz/papers/layered-grammar.html).\n","\n","Plots in ggplot2 are \"built up\" using multiple functions connected with the plus sign (+). The first function, ggplot(), just draws the outline of the plot, including the the axes and tick marks. It takes two arguments.\n","1. The dataset that you want to plot. \n","2. A function, aes(), short for aesthetic. This function itself takes multiple arguments. Let's start by using x & y, which will tell the function which columns of the data_frame to plot on the x axis and y axis."]},{"cell_type":"code","execution_count":2,"id":"dec53713","metadata":{"_cell_guid":"db6d266a-10bb-49dc-8c47-b7a785d0c6d7","_uuid":"57eb44d88c2614f97d347645d45e8fe2bf2b3c1c","execution":{"iopub.execute_input":"2022-02-21T06:50:13.643429Z","iopub.status.busy":"2022-02-21T06:50:13.604299Z","iopub.status.idle":"2022-02-21T06:50:14.192346Z","shell.execute_reply":"2022-02-21T06:50:14.191154Z"},"papermill":{"duration":0.715156,"end_time":"2022-02-21T06:50:14.192506","exception":false,"start_time":"2022-02-21T06:50:13.47735","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nO3deWAkZZ34/6fvnJNkDk4HGBAZuUFQQBS8fig6CqILHiAgl8KqKHIIIrcXAoKw\nsLgiKl8QRRQVWAUVcJEFBESQU2VErsEZZnKnk+7+/dEQBphkMpBUZ596vf7qVCrVn5qqSr/T\n3clkarVaAADg/75sowcAAGByCDsAgEgIOwCASAg7AIBICDsAgEgIOwCASAg7AIBICDsAgEjk\nGz3Ai9VqtaVLlzZ6ihWbMWNGX19fpVJp9CAJaWtry+Vy5XJ5YGCg0bMkpFgsFgqFvr6+Rg+S\nkFwu19bWFkLo6empVquNHich7