ent geoms require different aesthetics. If your code runs but doesn't return a plot, it's usually because you've given ggplot() one set of aesthetics, but the geom you're using need a different set. geom_histogram(), for example, only needs to  know what to plot on the x axis. If you tell it to plot something on the x axis and something else on the y axis, it won't return the plot you're expecting.\n","\n","For now, let's start by adding points to our plot, one for each data point. You may know this as a \"scatter plot\"."]},{"cell_type":"code","execution_count":3,"id":"c63a1cf6","metadata":{"_cell_guid":"81ee8e95-8c6b-48ab-9b0f-f2d8de0412fc","_uuid":"7cef0d0b37d8973e901dae8962969ccc8620d004","execution":{"iopub.execute_input":"2022-02-21T06:50:14.602179Z","iopub.status.busy":"2022-02-21T06:50:14.600214Z","iopub.status.idle":"2022-02-21T06:50:14.93918Z","shell.execute_reply":"2022-02-21T06:50:14.9374Z"},"papermill":{"duration":0.412717,"end_time":"2022-02-21T06:50:14.939292","exception":false,"start_time":"2022-02-21T06:50:14.526575","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeWAU5eH/8Wdmr9wXySYBOcItFhFFUWtVKohVRKp4Q7WKoKIg1rN4AIon9UBF\n8ahHRfC+6gUWi2hBKqLWAxAUUCGH5CLk2Ozu/P7YNr98szuT3WF3ZvfJ+/VXmNnNfCYzs/PZ\nuVA0TRMAAABIfardAQAAABAfFDsAAABJUOwAAAAkQbEDAACQBMUOAABAEhQ7AAAASVDsAAAA\nJEGxAwAAkITT7gAdaZpWW1trd4rIcnJy9u7dGwgE7A5ikaysLIfD4fP5mpqa7M5iEbfb7XK5\n9u7da3cQizgcjqysLCHEnj17gsGg3XEskp2d3dzc3NraancQi2RkZLhcrtbW1sbGRruzWMTp\ndKanp+/Zs8fuIBZRVTU7O1sIsXfvXr/fb3cci2RmZvr9/paWFruDWCQtLc3j8QQCgYaGBiFE\nfn6+3iuTsdglbXNyOBzBYDBp48Wdoiiqqgohus4sa5qmKErXmV9VVUOLuKut2Mn8OZMIqqp2\nqRXb4XCoqtp15lfTNDbkrkBV1WgWMadiAQAAJEGxAwAAkATFDgAAQBIUOwAAAElQ7AAAACRB\nsQMAAJAExQ4AAEASFDsAAABJUOwAAAAkQbEDAACQBMUOAABAEhQ7AAAASVDsAAAAJEGxAwAA\nkATFDgAAQBIUOwAAAElQ7AAAACRBsQMAAJAExQ4AAEASFDsAAABJUOwAAAAkQbEDAACQBMUO\nAABAEhQ7AAAASVDsAAAAJEGxAwAAkATFDgAAQBIUOwAAAEk4rZlMxZrZF93+n/ZDLnjyhQ